import { createBrowserRouter } from "react-router-dom";
import Root from "./Root";
import About from "./Screen/About";
import Home from "./Screen/Home";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Root />,
    children: [
      {
        path: "home",
        element: <Home />,
      },
      {
        path: "about",
        element: <About />,
      },
    ],
  },
]);

export default router;
